Arguments heard as to bail. Defendant was previously remanded on 4/25/15. Court ordered cash bail be set at $5,000.00 with turnover to Justice Point Monitoring. Court ordered the following conditions: 
-No contact with the victim or her school or residence;
-No contact with the victim's family;
-Maintain absolute sobriety;
-Commit no new crimes rising to the level of probable cause;
-No possession of any weapons;
